import{_ as e,c as t,o as a,a2 as _}from"./chunks/framework.CCJxyEhR.js";const m=JSON.parse('{"title":"第二十六卦 大畜 山天大畜 艮上乾下","description":"","frontmatter":{},"headers":[],"relativePath":"zhouyi_26.md","filePath":"zhouyi_26.md"}'),o={name:"zhouyi_26.md"},p=_('<h1 id="第二十六卦-大畜-山天大畜-艮上乾下" tabindex="-1">第二十六卦 大畜 山天大畜 艮上乾下 <a class="header-anchor" href="#第二十六卦-大畜-山天大畜-艮上乾下" aria-label="Permalink to &quot;第二十六卦 大畜 山天大畜 艮上乾下&quot;">​</a></h1><p>大畜：利贞，不家食吉，利涉大川。</p><p>彖曰：大畜，刚健笃实辉光，日新其德，刚上而尚贤。能止健，大正也。不家食吉，养贤也。利涉大川，应乎天也。</p><p>象曰：天在山中，大畜；君子以多识前言往行，以畜其德。</p><p>初九：有厉利已。象曰：有 厉利已，不犯灾也。</p><p>九二：舆说辐。象曰：舆说辐，中无尤也。</p><p>九三：良马逐，利艰贞。曰闲舆卫，利有攸往。象曰：利有攸往，上合志也。</p><p>六四：童豕之牿，元吉。象曰：六四元吉，有喜也。</p><p>六五：豶豕之牙，吉。象曰：六五之吉，有庆也。</p><p>上九：何天之衢，亨。象曰：何天之衢，道大行也。</p>',10),r=[p];function s(c,i,n,d,h,l){return a(),t("div",null,r)}const f=e(o,[["render",s]]);export{m as __pageData,f as default};
